text:
*@_MasterofFear seems rather interesting. Don’t mind her, slipping into his office, and sitting upon his desk— waiting for his return.~

//HI, GOOBER. 
         ...Stuck with me again&lt 3

If breaking me means
to let Your Name be glorified, 
for me to spend more time with You, 
for me to know You even more,
then break me, Lord.
Break me for Your Name's sake.
